import React from 'react'

function SearchBox() {
    return (
        <div className="bg-searchBarGrey">
            <form id="form"> 
            <input type="search" className="bg-gray-100" id="query" name="q" placeholder="Search..." />
            <button>Search</button>
            </form>
        </div>
    )
}

export default SearchBox
